import React  from "react"

const Table = (props) => {
    const title  = props.tableName;
    const data   = props.details[title];
    const headerJsx = Object.keys(data[0])
                .map(values => <th> {values}</th>);
    const rows = Object.values(data).map(val => Object.values(val));
    return (
    <div>
        <table>
            <tr>
                <th> # </th>
                {headerJsx}
            </tr>
            {
                rows.map(row => 
                    <tr>
                        {
                            row.map(val => <td>{val}</td>)
                        }
                    </tr>
                )
            }
        </table>
    </div>
    )

} 

export default Table;
